INSERT INTO `artists` (`id`, `name`, `description`, `base64image`)
VALUES
	(1,'The Beatles','Emerging from Liverpool, England in 1960, the Beatles were a seminal British group that evolved from rock/pop origins into pioneers of musical experimentation. The band solidified its iconic lineup in 1962, featuring John Lennon (vocals, rhythm guitar, harmonica, keyboards, percussion), Paul McCartney (vocals, bass, guitar, keyboards, percussion), George Harrison (lead guitar, vocals, keyboards), and Ringo Starr (drums, vocals, percussion) after signing a recording contract with EMI. This followed a brief period with Stuart Sutcliffe (bass, 1960-61) and Pete Best (drums, 1960-62).\n\nInitially recognized for their Merseybeat style, the Beatles soon ventured into uncharted musical territories, exploring psychedelia and pioneering innovative production techniques that incorporated tape loops and other effects. Over their active years, they created a legacy of 12 studio albums.\n\nTheir profound impact on rock and roll was acknowledged in 1988 when they were inducted into the Rock And Roll Hall of Fame as a group. By 2015, each member had also received individual recognition for their contributions as solo artists within the Hall of Fame.','data:image/jpeg;base64,'),
	(2,'The Rolling Stones','The Rolling Stones are a band from London, formed in 1962, named after a Muddy Waters song and consisting of 6 people. Harmonica player, Brian Jones; Pianist, Ian Stewart; Vocalist, Mick Jagger; Guitarist, Keith Richards; Bassit, Bill Wyman and Drummer, Charlie Watts. They played lots of American R&B and some blues cover songs, but Rock and Roll was always in their listings. However, after 7 years, Brian Jones left the group and was quickly replaced by Mick Taylor. 5 years after joining, Taylor quit and once again, the role of the harmonica player had to be filled, this time by Ronnie Wood. Ian Stewart retired from the group in 1963 but still played occasional keyboard for the band until 1985, when he died. In 1982, Chuck Leavell took over as primary keyboardist. In 1993, Bill Wyman left the band and was replaced by Darryl Jones.\n\nTheir first recorded single was a cover of Chuck Berry\'s \"Come On\". Although only one promotional ad was purchased, the song climbed the charts to #21 which then allowed them to do a tour of the UK as a supporting act for some American artists.\n\nThe Rolling Stones had released 2 albums in England before getting a top 10 song in the U.S. In 1965, their song \"Satisfaction\" was a worldwide #1. Some large events that happened in the year, Lyndon B. Johnson became president, The Gambia is separated from the United Kingdom, and Malcolm X is assassinated.\n\nThe 80\'s were a rough time for the band. Everybody was making solo albums while trying to work on one for the band and they were all getting quite frustrated with eachother. There were rumors that the band wasn\'t sure if they were going to stay together. In 1989, these rumors were resolved when the Rolling Stones released \"Steel Wheels\" which sold over 2 million copies.\n\nIn 1993, Bill Wyman decided that it was time for him to be done and retired from the group. He was quickly replaced by Darryl Jones. Later that year, the Stones announced that they were doing another tour. This was greeted by complaints from some critics, saying that the band was simply too old to still be around. However, that album sold more than four-million copies and the supporting tour, containing 22 songs from the bands 30-year history was the highest selling tour of all time.','data:image/jpeg;base64,');

INSERT INTO `artists` (`id`, `name`, `description`, `base64image`)
VALUES
	(3,'Sam Cooke','Sam Cooke (born 22 January 1931, Clarksdale, Mississippi, USA - died December 11, 1964, Los Angeles, California, USA) was an American gospel/R&B/soul/pop singer, songwriter and entrepreneur.  He is recognized as one of the founders of soul music and one of the most important singers in soul music history. \n\nDetails about his death are still in dispute; official police records state he was killed by a gunshot. \n\nYounger brother of Charles Cook (who co-wrote Chain Gang) and elder brother of L.C. Cook.\n\nInducted into Rock And Roll Hall of Fame in 1986 (Performer).\nInducted into Songwriters Hall of Fame in 1987.','data:image/jpeg;base64,'),
	(4,'Ella Fitzgerald','Ella Fitzgerald who was known as the “First Lady of Song”, was an American Jazz and song vocalist. Born in 1917, she began singing after a troubled childhood. Ella debuted at the Apollo Theater at the age of 17 and was discovered at an amateur contest.\n\nIn 1958, she became the first African-American woman to win a Grammy Award. In her lifetime she won 13 Grammy Awards and has sold over 40 million copies of her albums. Her multi-volume \"songbooks\" on Verve Records are among America\'s recording treasures. Fitzgerald died in California in 1996. \n\nDuring her lifetime, she worked with many jazz greats such as Benny Goodman, Duke Ellington, Count Basie and Frank Sinatra.','data:image/jpeg;base64,');

/*!40000 ALTER TABLE `artists` ENABLE KEYS */;
